import React from "react";
import BotCard from "./BotCard";

function BotCollection({
  bots,
  enlistedBots,
  enlistBot,
  deleteBot,
  setEnlistedBots,
}) {
  return (
    <div className="ui four column grid">
      <div className="row">
        {/* Collection of all bots */}
        {bots.map((bot) => (
          <BotCard
            key={bot.id}
            bot={bot}
            enlistedBots={enlistedBots}
            enlistBot={enlistBot}
            deleteBot={deleteBot}
            setEnlistedBots={setEnlistedBots} // Pass the setEnlistedBots function as a prop
          />
        ))}
      </div>
    </div>
  );
}

export default BotCollection;
